Okay, so if you roll two dice, there are lots of combinations you can get.  Like, the first die could be a 1 and the second a 2, or both could be 3s, and so on.

To get a difference of 0, both dice have to show the same number.  There are six ways that can happen: both 1s, both 2s, both 3s, and so on up to both 6s.

Since there are 36 total combinations (6 sides on one die times 6 sides on the other), the chance of getting the same number on both dice is 6 out of 36. That simplifies to 1 out of 6. 


\begin{align*}
\boxed{\frac{1}{6}}
\end{align*}

Okay, so we have this triangle, right? And there are these lines going down from each corner, meeting at a point called the orthocenter.  We know how long some of these lines are, and we need to figure out how long one part of one of them is.

Here's what I'm thinking:

* Those lines going down from the corners are called altitudes, and they make right angles with the sides of the triangle.

* Since we have right angles, we can use similar triangles to help us out.

*  If two triangles are similar, it means they have the same shape, just different sizes.  That means their sides are proportional.

Let me draw a little picture to help me think...

[asy]
unitsize(0.3 cm);

pair A, B, C, D, E, F, H;

A = (5,12);
B = (0,0);
C = (14,0);
D = (A + reflect(B,C)*(A))/2;
E = (B + reflect(C,A)*(B))/2;
F = (C + reflect(A,B)*(C))/2;
H = extension(B,E,C,F);

draw(A--B--C--cycle);
draw(A--D);
draw(B--E);
draw(C--F);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, S);
label("$E$", E, NE);
label("$F$", F, NW);
label("$H$", H, SE);
[/asy]

Okay, so triangles $BHD$ and $CED$ look similar to me. They both have a right angle, and they share angle $D$.

That means the sides are proportional. We know $BD$ is 5 and $CD$ is 9. We also know $CE$ is 42/5.  We need to find $HE$.

Hmm, this is tricky. I'm gonna have to think about this some more...

Okay, so we have this triangle ABC, and we need to find the area of this weird shape inside it.

First, I drew a picture to help me see what's going on.

[asy]
