I know how to find the area of a triangle, so I can find the area of the big triangle ABC. It's like half the base times the height. The base is 12, and the height is 5, so the area is (1/2) * 12 * 5 = 30.

Now, I need to figure out the areas of those little triangles inside.  They're right triangles, which makes things easier.

Triangle AMJ has a base of 1 and a height of... hmm, I need to figure that out.  It looks like it's a smaller version of the big triangle, so maybe I can use that to find the height.

Triangle BNK is also a right triangle. I can find its base and height the same way I did for triangle AMJ.

Once I have the areas of all the triangles, I can subtract the areas of the little ones from the area of the big one to get the area of the pentagon. 

Let me do some more calculations...

Okay, so we have a circle with six dots around it, like a pizza cut into six slices. We need to use three of those dots to make a triangle, but it can't be a triangle where all the sides are the same or where only two sides are the same.

Think about it: if we connect every other dot, we get a triangle where all the sides are the same length – that's an equilateral triangle!

Now, imagine taking one of those little triangles out of the big one. The triangle we're left with is the one we want. It's a bit tricky to figure out the exact size, but we know the big triangle is made up of six little triangles that are all the same.

Since the big triangle is made of six of those little triangles, and each little triangle has an area of (√3/4), the big triangle has an area of 6 * (√3/4) = (3√3)/2.

Finally, we take away one of those little triangles: (3√3)/2 - (√3/4) = (3√3)/16.



\begin{align*}
\boxed{\frac{3\sqrt{3}}{16}}
\end{align*}

Okay, so we have this right triangle, right?  One side is 4√2 and the other is 2.  We need to find the length of the line that goes from the corner to the middle of the longest side.

I remember my teacher saying something about medians in right triangles.  She said the median to the longest side is half as long as the longest side!

So, the longest side is 4√2, so half of that is 2√2.


\begin{center}
$\boxed{2\sqrt{2}}$
\end{center}

Okay, so Sean has a bunch of sand in small containers, and he wants to put it all in bigger containers.  

The big containers are twice as wide as the small ones, right? That means they can hold a lot more sand! Since the big containers are four times bigger than the small ones, he'll only need a quarter of the number of big containers.

He has 12 small containers, so he'll need 12 divided by 4, which is 3 big containers. 


\begin{center}
$\boxed{3}$
