Okay, so we have this triangle, right? And there's a circle inside touching all the sides.  We need to find this angle EDF.

Here's what I think:

* The lines from the circle to the triangle sides are like little arms reaching out.  They're the same length on each side of the circle.

* That means the angles those arms make with the sides of the triangle are also the same on each side.

* If we look at the whole triangle, we know one angle is 72 degrees. The other two angles have to add up to 108 degrees (because all the angles in a triangle add up to 180).

* Now, think about the little triangle EDF. Its angles have to add up to 180 degrees too. We know two of the angles are the same as the ones we just figured out.

* So, we can subtract those two angles from 180 to find the last angle, EDF.

Let me try to draw it out...

[asy]
